import React from "react";
import { useNavigate, BrowserRouter, Routes, Route } from "react-router-dom";
import styles from './Base.module.css'



function Base(){

    return(
        <div className={styles.container}>
            <img src="./img/free-icon-man-658032.png" alt="Image"></img>

            <a className={styles.left_link} href="#">Menu1</a>
            <a className={styles.left_link} href="#">Menu2</a>


            <a className={styles.right_link} href="#">Login</a>

        </div>
    )
};

export default Base;
